def min_finder(arrayList): # it finds at the bottom of the Person or Pet
    minimumY = 9999.0 
    for fields in arrayList:
        if fields[1] != "a" and float(fields[1]) < minimumY:
            minimumY = float(fields[1])
    return minimumY

def max_finder(arrayList): # it finds at the top of the Person to replace the crown
    maximumY = 0.0 
    for fields in arrayList:
        if fields[1] != "a" and float(fields[1]) > maximumY:
            maximumY = float(fields[1])
    return maximumY

